import "./widgetBlock5.css";

export const WidgetBlock5 = () => {
  return (
    <div className="widgetContainer5">
      <img src="\img\Group 2740 (1).svg" alt="img" className="widgetImg5" />
      <span className="widgetTitle5">Konektovanih korisnika</span>
      <span className="widgetNum5">98</span>
      <span className="widgetStat5">+5 ove sedmice</span>
    </div>
  );
};
